import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import UofTResources from './UofTResources';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <nav className="App-nav">
          <Link to="/" className="nav-item">Home</Link>
          <Link to="/uoft-resources" className="nav-item">UofT Resources</Link>
          <Link to="/resume" className="nav-item">Resume</Link>
        </nav>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/uoft-resources" element={<UofTResources />} />
          {/* Define more routes if needed */}
        </Routes>
      </div>
    </Router>
  );
}

function Home() {
  return (
    <header className="App-header">
      {/* Your home page content */}
    </header>
  );
}

export default App;
